        <ul>
          <li>Naziv provjere: 17 bodova</li>
          <li>Naziv provjere 2: 87 bodova</li>
          <li>Naziv provjere 3: 54 bodova</li>
          <li>Naziv provjere 4: 12 bodova</li>
        </ul>
      </div>
      <div className="column">
